import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import React, { useNavigate } from "react";
import { Link } from "react-router-dom";
import Login from "./components/Login";
import Layout from "./Layout";
import { Navbar } from "react-bootstrap";
import { Startup } from "./components/Startup";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import Register from "./components/Register";
import StartupList from "./Pages/StartupList";
import User from "./components/User";
import Portfolio from "./Pages/Portfolio";

async function App() {
  // let navigate = useNavigate();
  // const routeChange = () => {
  //   let path = `./components/login`;
  //   navigate(path);
  // };

  try {
    let result = await axios.post(          // any call like get
      "http://127.0.0.1:5000",         // your URL
      {                                     // data if post, put
        some: "data",
      }
    );
    console.log(result.response.data);
  } catch (error) {
    console.error(error.response.data);     // NOTE - use "error.response.data` (not "error")
  }

return (
  <div className="App">
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />} />
        <Route path="/login" element={<Login />} />
        <Route path="/registerStartup" element={<Register />} />
        <Route path="/startuplist" element={<StartupList />} />
        <Route path="/user" element={<User />} />
        <Route path="/Portfolio" element={<Portfolio />} />
      </Routes>
    </BrowserRouter>
  </div>
)
}

export default App;
